from pix2tex.im2latex_predict import predict

def im2latex(text):
    result = {}
    result['status'] = 'Thất bại'
    result['error'] = []
    if not text:
        result['error'].append("Please provide image")
    else:
        try:
            result['status'] = 'Thành công'
            result['latex'] = predict(text)
        except:
            result['status'] = 'Thất bại'
            result['error'].append("Can't convert image to LaTeX")
    return result
